import { useEffect, useState } from "react"
import axios from 'axios'

function List(){
    const[data,setdata]=useState([])
    function list(){
        axios.get(" http://localhost:4444/student").then((details)=>{
            setdata(details)
        })
    }
    useEffect(()=>{
        list()
    },[])
    return(
        <>
        <h3>This is List of Data</h3>
        <p>{data.map((showdata)=>{
            return showdata.Studentname
        })}</p>
        </>
    )
}
export default List
